<div class="entities" style="line-height: 2.5; direction: ltr">The influence of ionotropic and metabotropic glutamate receptor ligands on anxiety-like effect of amphetamine withdrawal in rats . Chronic amphetamine use results in anxiety-like states after drug cessation . The aim of the study was to determine a role of ionotropic and metabotropic glutamate receptor ligands in amphetamine-evoked withdrawal anxiety in the elevated plus-maze test in rats . In our study memantine ( 8 and 12 mg / kg ) , a noncompetitive N-methyl-d-aspartate ( DB01221 ) receptor antagonist did not reduce amphetamine withdrawal anxiety . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00659
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( DB01221 and metabotropic glutamate 5 receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P41594
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) antagonist ) at the dose 200 and 400mg / kg showed anxiolytic-like effect , thus increasing the percent of time spent in open arms and a number of open arm entries . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P41594
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 selective antagonist , MTEP ( 3 - [ ( 2 - methyl -1,3- thiazol - 4 - yl ) ethynyl ] pyridine hydrochloride ) and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q14416
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Dual ligands targeting dopamine D2 and serotonin 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors as new antipsychotical or anti-Parkinsonian agents . Psychiatric disorders like schizophrenia and neurodegenerative diseases like Parkinson ' s disease are associated with poly-factorial pathogenic mechanisms , with several neurotransmitter systems closely involved . In addition to the cerebral dopaminergic ( DA ) system , the serotoninergic ( 5 - HT ) system also plays a crucial role in regulating psychoemotional , cognitive and motor functions in the central nervous system ( CNS ) . Among the large 5 - HT receptor family , accumulating data have revealed new insights into the therapeutic benefit of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 receptor in treating various CNS disorders , especially schizophrenia and Parkinson ' s disease . The present review discusses the advance of dual agents with mixed actions at the dopamine D2 and serotonin 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors in the treatment of these diseases . Aripiprazole was the only marketed drug with dual D2 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 profile . It is a partial D2 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor agonist and has been prescribed as an atypical antipsychotical drug . Two other drugs DB06016 and Pardoprunox are being investigated in clinic . Most of the other candidate compounds , including 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , Sarizotan , Mazapertine succinate , PF - 217830 , and Adoprazine were discontinued due to either non-optimal pharmacokinetic properties or insufficient therapeutical efficacy . Although much effort has been done to highlight the advantages of the

 and D2 dual approach , it has to be pointed out that many of these drugs showed poly-pharmacological profile by targeting many other receptors and / or transporters besides the D2 and

 receptors . In this regard , ' pure ' compounds exclusively acting on the D2 and

 receptors are highly needed to further validate this approach . Meanwhile , safety concerns and in vivo pharmacokinetic alerts should also be implanted to the drug design art early .</div>
